import {
  AUTH_LOADING,
  REGISTER_SUCCESS
} from '../actions/auth';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case AUTH_LOADING:
      return {
        ...statePart,
        isFetching: true
      }
    case AUTH_LOADING:
      return {
        ...statePart,
        token: action.payload
      }

    default:
      return statePart;
  }
}
